import React, {Component} from 'react'
import Student from "./Student.js"

// const App =(props)=> {
//   return (
//     <div>
//       <h1>hello {props.name}</h1>
//     </div>
//   )
// }

class App extends Component{
    render(){
        return(
        <>
        <h1>Hello {this.props.name}</h1>
        <Student/>
        <Student/>
        </>
            
        )
    }
}
export default App;
